import React from "react"

function Card(props){
    return(
      <div className="card">
        <div className="top">
          <h2 className="name">{props.name}</h2>
          <img className="circle-img" src={props.img}
                alt="avatar-image" />
                <div className="bottom">
                  <p className="info">{props.tele}</p>
                  <p className="info">{props.email}</p>
                </div>
        </div>
      </div>
  
    )
  }

  export default Card;
